B.Iw=new A.ae("PDCA Wall Review","Start: -77 - End: -8","The PDCA Wall Review is a series of reviews to assess the readiness for production of a specific supplier facility through the Global Vehicle Development Plan. The focus is to assess product and process readiness within APQP Scope & Timeline for HR, Facility, Manufacturing and Engineering, Material Operations and BIQS Glidepath; understand and establish Risk Mitigation at the supplier site.",u.X,"GM 1927 31a\nGM 1927 31b\nGM 1927 05")
B.Id=new A.ae("Greenfield Facility Implementation Follow Up","Start: -77 - End: -49","Greenfield Facility Implementation Follow Up applies to brand new supplier manufacturing facilities (Greenfield) and existing supplier manufacturing facilities that are new to GM business (Brownfield) to ensure the supplier manufacturing site will be ready in terms of Facility, Organization, Operation, Purchasing and Supply Chain.","The Wiring SQE along with the SQ GF/BF coordinator is responsible of assessing at the supplier each of the items of the GM 1927 31 Greenfield Development Assessement Checklist and follow up on the plan to close and closure of all the items identified as non compliant before the PVVB builds. ","GM 1927 31")
B.Iz=new A.ae("Manufacturing Process Concept Review","Start: -74 - End: -74","The Manufacturing Process Concept Review is where the supplier presents to the wiring SQE the proposed layout including the details about the type of equipments they are going to use to meet Supplier Daily Capacity and detection levels for the failure modes already identified during sourcing, this presentation shall be aligned to what was presented during technical reviews, but including more detail in terms of equipment. ","The Wiring SQE is responsible of requesting this information to the supplier and asking them to present it. This revision can be part of the Manufacturing and Engineering portion of the PDCA Wall Review.","Quality Presentation from Sourcing\nIndustrialization Plan\nProposed Layout\nFlow Chart")
B.J4=new A.ae("D to PFMEA Gap Analysis","Start: -74 - End: -74","Supplier shall conduct D to P Gap Analysis based on the last DFMEA released and involve GM Purchasing, GM Engineering, GM SQE and Internal areas as they required. Supplier shall assure D to P gap analysis matchs with control detections committed during sourcing and safety lessons learned shared. Supplier shall request approval of transition forms as required","The Wiring SQE shall assure D to P gap analysis matchs with detection controls committed during sourcing and keep consider last safety lessons learned. Also, ensure the Transition forms are approved by Technical Specialist SQE.","DFMEA\nInitial PFMEA\nGM1927 21 DFMEA PFMEA Gap Analysis Process and Transition Form")
B.Iq=new A.ae("Machinery PO's complete","Start: -74 - End: -72","Machinery PO's complete means supplier has placed all the Purchase Orders for machinery such as Cutting & Crimping machines, Twisting machines, Ultrasonic welding machines, Heatshrink ovens with the required tools and detections  and equipment so as cross section mini labs and Bubble Tester for the first phase of their industrialization plan.","The Wiring SQE is responsible of reviewing that the supplier has placed the required PO's for Crimping/Cutting, Twisting, Ultrasonic Welding, Terminal Soldering  and Seal Application equipments to meet the first phase of their industrialization plan, this includes confirming that the equipments  will have the required detections agreed during sourcing and that the estimated time of arrival is before starting to cut circuits for PVVB MRD.",u.E)
B.IK=new A.ae("Dimensional & EOL Test Concept Approval","Start: -70 - End: -70","Dimensional & EOL Test Concept Approval is a revision where the supplier explains how their dimensional boards and end of line testers are going to work, including the type and amount of modules/features, tolerances, boards shape (dimensional board in 3D) and layout and software for quality analysis and traceability.","The Wiring SQE is responsible of scheduling this review including the PSDS regional process lead and approve these concepts before supplier starts building them, but only after all the requirements are met and lessons learned considered.","GM 1927 16a CG4210 PSDS SOR Section 11")
B.J5=new A.ae("Concept Vehicle Engineering Batch Release","Start: -70 - End: -66","Engineering design release for vehicle validation and PVVB Build.","","3D Math Data\nNetlist")
B.IA=new A.ae("DFMEA Complete","Start: -66 - End: -66","Design Failure Modes and Effects Analysis documents specific for the program closed and shared with the supplier, this should include the clarification / update of open items from previous gap analysis revisions / agreements.","The Wiring SQE shall verify Suppliers know about DFMEA updated and shared by GM Engineering, and it is considering last engineering level.\n-If Suppliers are Design owner, the DFMEA can be created by Supplier Engineering-\nManufacturing team shall demonstrate evidence of DFMEA is able to all team members at facility.","DFMEA\nGM 1927 21 DFMEA PFMEA Gap Analysis Process and Transition Form")
B.IW=new A.ae("Initial 2D release","Start: -66 - End: -62","The Wiring Harness 2D is the pictorical representation of the 3D math and Netlist for each harness family that the supplier uses to design their boards (assembly) and detailed manufacturing process for PVVB Builds and Supplier Engineering is responsible of drafting it, reviewing it and releasing it. ",u._,u.r)
B.Is=new A.ae("PFMEA Complete Review","Start: -60 - End: -59",u.D,u.o,u.u)
B.IF=new A.ae("Run at Rate Workbook Review","Start: -60 - End: -58","Supplier shall ensure that contracts were received at last engineering level. And SQMS has been updated.",u.c,"GM 1927 35a Run at Rate Workbook\nSQMS")
B.Ik=new A.ae("Lessons Learned Review","Start: -60 - End: -58",u.d,u.W,"Lessons Learned List (SPPS system, PRTS system, GRA sharepoint)")
B.J7=new A.ae("PVVB Process Control Plan Review","Start: -59 - End: -58",u.m,u.v,"Control Plan\nPFMEA")
B.I3=new A.ae("Current Tooling & Equipment Review","Start: -58 - End: -58","This checkpoint is to review the conditions of the existing equipment the supplier is intending to use for the project and if it has any gaps against GM requirements, so as to review the status of the delivery of the equipment from the Purchase Orders placed before to identify what is missing for the first MRD (PVVB).","The Wiring SQE is responsible of conducting this revision that can be either on site (preferably) or remote but ensuring supplier has all the details of the plan and that the equipment capabilities match the controls offered during sourcing and the D to P Gap Analysis so as that the capacity matches what was documented on the run at rate workbook. The wiring SQE should request the support from the Regional Process Lead, his/her Team Leader and Manager, this revision can be part of the agenda of the PDCA Wall Review, but making the supplier aware of the level of detail required so they can be prepared. This revision should occur before completing the CRV PVER Assessment in case there is any item that needs to be documented there.","Quality Presentation from Sourcing\nPFMEA\nControl Plan\nIndustrialization Plan")
B.I9=new A.ae("CRV PVER","Start: -58 - End: -58","CRV is a cross functional assessment that proactively confirms that PDT Quality Chain standard work is completed at PVER. The responsible for this valve is the validation engineer.","The Wiring SQE has to participate in this meeting and escalate any incomplete activity from this list and/or any potential issue that can put in risk a milestone.","CRV Assessment in Auros")
B.I6=new A.ae("Production Vehicle Engineering Batch Release","Start: -60 - End: -56","Engineering design release for vehicle PPV Builds.","","")
B.J0=new A.ae("PVER 2D Release","Start: -56 - End: -52","The Wiring Harness 2D is the pictorical representation of the 3D math and Netlist for each harness family that the supplier uses to design their boards (assembly and dimensional) and detailed manufacturing process; this will be the baseline to approve Non Saleable PPAP and Supplier Engineering is responsible of drafting it, reviewing it and releasing it. ",u._,u.r)
B.IX=new A.ae("Reverse PFMEA Audit Checklist and Calendar","Start: -58 - End: -54","Reverse PFMEA is a Proactive - Go-and-See on-station review of all failure modes included in the PFMEA conducted by a cross-fuctional team, focused to verify that all the failure modes have proper controls (prevention/detection) and they are working properly.","The Wiring SQE is responsible of ensuring the supplier has a Reverse PFMEA Audit Checklist and a schedule to perform the Reverse PFMEA activity according GM 1927 36 Built In Quality Supply-Base (BIQS) Elements Presentation - Reverse PFMEA; Risk Reduction on each station shortly after the station is released and starts working continuously ensuring all of the intended stations for the project are coverd during the launch of the project.","GM 1927 36 Built In Quality Supply-Base (BIQS) Elements Presentation - Reverse PFMEA; Risk Reduction\nPFMEA\nReverse PFMEA Audit Checklist\nReverse PFMEA Calendar")
B.IG=new A.ae("100% Subtiers Contracted","Start: -50 - End: -50","All Subtiers sending parts to the harness supplier for the harness assembly shall be identified and contracted by this week with an initial assessment on the GM 1925 25 Subcontractor Program Status Matrix to start working on their PPAP Plans.","The Wiring SQE is responsible of reviewing the supplier has identified all the required subtiers for each item on the BOM and there are not any commercial items opened, so as that the supplier has included all of those on the GM 1925 25 Subcontractor Program Status Matrix, this means columns A to C will be definitive from now on and columns D to H already have an initial assessment.","BOM\nGM 1925 25 Subcontractor Program Status Matrix")
B.I1=new A.ae("MRD HVF Bld","Start: -49 - End: -49","The Harness Verification Frame Build occurs at PPO and is where all the Electrical Connections of the vehicle are made to validate electrical and electronic systems work as intended, suppliers are required to send fully functional (electrically) harnesses for this build.","The Wiring SQE should support the DRE to ensure the supplier sends the requested harnesses at the requested level.","PDT Meeting Minutes")
B.Ig=new A.ae("Hanking Concept Approval","Start: -50 - End: -48","GM Launch Electrical Wiring Coordinator and Launch Electrical Process Coordinator coordinate a Workshop with the Harness Supplier at PPO to get the hanking needed to protect the harness while processing the vehicle through the plant process without tucking the harness into openings in the vehicle that could cause damage.","The Wiring SQE is responsible of ensuring this workshop occurs and the outcome / agreements were properly documented, so that supplier can start working on releasing the Hanking 2D and Hanking instructions for the PVVB MRD.","BoO-Electrical - 317 - Harness Hanking Workshop")
B.Iy=new A.ae("Subtiers PPAP Plan","Start: -50 - End: -48","At this stage, the Wiring supplier shall have agreed a plan with all the subtiers for PPAP submission, capacity demonstration and approval dates and downloaded the complete information into the GM 1925 25 Subcontractor Program Status Matrix.","The Wiring SQE is responsible of reviewing the supplier has the information required on each of the GM 1925 25 Subcontractor Program Status Matrix cells and that the dates considered in this file will not impact program milestones.",u.L)
B.I4=new A.ae("Tooling & Equipment Status","Start: -49 - End: -48","This a checkpoint to review all the equipment ordered for this stage is already at the plant and ready to start production.","The Wiring SQE is responsible of confirming that the equipments ordered for Crimping/Cutting, Twisting, Ultrasonic Welding, Terminal Soldering  and Seal Application are at the plant and have the required detections agreed during sourcing.",u.E)
B.IO=new A.ae("FPSO PVVB","Start: -47 - End: -47",u.B,u.Y,"FPSO Checklist")
B.IJ=new A.ae("PVVB CG4210 Compliance Audit","Start: -46 - End: -46",u.R,"The Wiring SQE is responsible of coordinating with his PSDS Regional Process Lead the date of the audit, so as ensuring the supplier sends their self assessment one week in advance and participating in the audit and following up on the open items with the supplier until those are closed.","GM 1927 16a Wiring Harness and Battery Cable Process/Commodity Audit\nM7 Form (Exception List)")
